                "link": "https://www.devdiscourse.com/article/politics/3128898-shinde-revokes-pangarkars-appointment-amid-controversy",
                "description": "Shinde Revokes Pangarkar's Appointment Amid Controversy Maharashtra Chief Minister Eknath Shinde has retracted the appointment of Shrikant Pangarkar, an alleged accomplice in journalist Gauri Lankesh's murder, from the Shiv Sena amidst significant public outrage. Issued on Sunday, Shinde's directive nullifies all district-level positions held by Pangarkar in Jalna, marking a significant reversal for the Shiv Sena.The official order stated, \"Eknath Shinde, Chief Minister of Maharashtra and the head of Shiv Sena, has annulled any appointment orders concerning Shrikant Pangarkar. All decisions made at the district level in Jalna are hereby null and void.\" This decision closely follows Pangarkar's re-induction into the party just two days prior, where he was assigned as the election campaign leader in Jalna.Pangarkar, previously a Shiv Sena corporator, re-entered the party on Friday. Gauri Lankesh, a renowned journalist, was tragically shot outside her Bengaluru residence on September 5, 2017. Pangarkar, among 18 arrested in the case, was detained in August 2018 but received bail from the Karnataka High Court in September this year.The Maharashtra Assembly elections are scheduled for November 20, with results expected on November 23. The Assembly's current term concludes on November 26. (ANI)",
                "content": "Maharashtra Chief Minister Eknath Shinde has retracted the appointment of Shrikant Pangarkar, an alleged accomplice in journalist Gauri Lankesh's murder, from the Shiv Sena amidst significant public outrage. Issued on Sunday, Shinde's directive nullifies all district-level positions held by Pangarkar in Jalna, marking a significant reversal for the Shiv Sena. The official order stated, \"Eknath Shinde, Chief Minister of Maharashtra and the head of Shiv Sena, has annulled any appointment orders concerning Shrikant Pangarkar. All decisions made at the district level in Jalna are hereby null and void.\" This decision closely follows Pangarkar's re-induction into the party just two days prior, where he was assigned as the election campaign leader in Jalna. Pangarkar, previously a Shiv Sena corporator, re-entered the party on Friday. Gauri Lankesh, a renowned journalist, was tragically shot outside her Bengaluru residence on September 5, 2017. Pangarkar, among 18 arrested in the case, was detained in August 2018 but received bail from the Karnataka High Court in September this year. The Maharashtra Assembly elections are scheduled for November 20, with results expected on November 23. The Assembly's current term concludes on November 26. (ANI) (With inputs from agencies.)",
