                "article_id": "0ed5162ad5a5145e91e3b17eaf705954",
                "title": "2 labourers killed, 5 others injured in terror attack in J&Kâ€™s Ganderbal",
                "link": "https://daijiworld.com/news/newsDisplay?newsID=1237066",

                "video_url": null,
                "description": "Srinagar, Oct 20 (IANS): Two labourers were killed and 5 others injured in a terrorist attack on a labourers camp in J&Kâ€™s Ganderbal district on Sunday, officials said.Officials sources said that terrorists attacked a camp of labourers of a private company engaged in building a tunnel between Gagangier....",
                "content": "Srinagar, Oct 20 (IANS): Two labourers were killed and 5 others injured in a terrorist attack on a labourers camp in J&Kâ€™s Ganderbal district on Sunday, officials said. Officials sources said that terrorists attacked a camp of labourers of a private company engaged in building a tunnel between Gagangier and the tourist resort of Sonamarg. \"Two labourers have been killed and 3 are injured in this terrorist attack that took place around 8.15 p.m. The injured have been shifted for treatment to Srinagar city,\" an official said. Army and police have rushed to the spot and the area has been cordoned off to trace the assassins, officials said. Chief Minister Omar Abdullah condemned the terrorist attack. \"Very sad news of a dastardly & cowardly attack on non-local labourers at Gagangir in Sonamarg region. These people were working on a key infrastructure project in the area. 2 have been killed & 2-3 more have been injured in this militant attack. I strongly condemn this attack on unarmed innocent people & send my condolences to their loved ones\", he said in a post on his X page. Sunday's attack comes two days after terrorists killed a non-local, identified as Ashok Chouhan, hailing from Bihar, in the Zainpora area of Shopian district. The terror attacks in the Kashmir Valley come after a spurt of terrorist activity, especially by hardcore foreign mercenaries, in hilly districts of the Jammu division including Poonch, Rajouri, Doda, Kathua, Udhampur, and Reasi, which witnessed a number of hit and run attacks on the army, other security forces and civilians in recent months, prior to the Assembly elections. Over 4000 trained commandos drawn from the elite Para commando force and those trained in mountain warfare have been deployed in the densely forested areas of these districts to prevent the terrorists from carrying out ambush attacks and then hiding in the difficult forest areas. In addition to the deployment of the army and the CRPF in these mountainous districts, police have also issued automatic weapons to the village defence committees (VDCs). The VDCs are groups of civilians trained to handle weapons to protect their villages and families from terrorists in remote, inaccessible areas of the Jammu division.",
